import React, { useState, useEffect } from 'react';

export const FeaturedProduct = ({ products = [] }) => {
    const [filteredProducts, setFilteredProducts] = useState(products);
    const [activeFilter, setActiveFilter] = useState("All");

    // Handle category filter change
    const handleFilterChange = (category) => {
        setActiveFilter(category);
        if (category === "All") {
            setFilteredProducts(products); // Show all products
        } else {
            setFilteredProducts(products.filter(product => product.category === category));
        }
    };

    return (
        <section className="featured spad">
            <div className="container">
                <div className="row">
                    <div className="col-lg-12">
                        <div className="section-title">
                            <h2>Featured Product</h2>
                        </div>
                        <div className="featured__controls">
                            <ul>
                                <li
                                    className={activeFilter === "All" ? "active" : ""}
                                    onClick={() => handleFilterChange("All")}
                                >
                                    All
                                </li>
                                <li
                                    className={activeFilter === "oranges" ? "active" : ""}
                                    onClick={() => handleFilterChange("oranges")}
                                >
                                    Oranges
                                </li>
                                <li
                                    className={activeFilter === "fresh-meat" ? "active" : ""}
                                    onClick={() => handleFilterChange("fresh-meat")}
                                >
                                    Fresh Meat
                                </li>
                                <li
                                    className={activeFilter === "vegetables" ? "active" : ""}
                                    onClick={() => handleFilterChange("vegetables")}
                                >
                                    Vegetables
                                </li>
                                <li
                                    className={activeFilter === "fastfood" ? "active" : ""}
                                    onClick={() => handleFilterChange("fastfood")}
                                >
                                    Fastfood
                                </li>
                            </ul>
                        </div>
                    </div>
                </div>
                <div className="row featured__filter">
                    {filteredProducts.map((product) => {
                        const { id, title, price, description, category, image } = product;
                        return (
                            <div
                                key={id}
                                className="col-lg-3 col-md-4 col-sm-6 mix"
                            >
                                <div className="featured__item">
                                    <div
                                        className="featured__item__pic set-bg"
                                        style={{
                                            backgroundImage: `url(${image})`,
                                            backgroundSize: "contain",
                                            backgroundPosition: "center",
                                            height: "250px",
                                        }}
                                    >
                                        <ul className="featured__item__pic__hover">
                                            <li>
                                                <a href="#">
                                                    <i className="fa fa-heart" />
                                                </a>
                                            </li>
                                            <li>
                                                <a href="#">
                                                    <i className="fa fa-retweet" />
                                                </a>
                                            </li>
                                            <li>
                                                <a href="#">
                                                    <i className="fa fa-shopping-cart" />
                                                </a>
                                            </li>
                                        </ul>
                                    </div>
                                    <div className="featured__item__text">
                                        <h6>
                                            <a href="#">{title}</a>
                                        </h6>
                                        <h5>${price}</h5>
                                    </div>
                                </div>
                            </div>
                        );
                    })}
                </div>
            </div>
        </section>
    );
};
